(8, 1, '<div class=\\\"quiz_tablediv 7\\\">\n<div id=\\\"question-desc-align\\\" class=\\\"m_question1\\\">\n<div id=\\\"m_question_desc\\\" class=\\\"11 eleven_quest\\\">A Bit Stands for:</div>\n<div class=\\\"clear\\\"></div>\n</div>\n</div>\n<div class=\\\"clear\\\"></div>\n<div class=\\\"answer_boxes flexboxes\\\">\n<div class=\\\"quiz_tablediv 12 multi_check_truefalse\\\">\n<div id=\\\"answer_option\\\">\n<div class=\\\"answer\\\"></div>\n</div>\n</div>\n</div>\n', NULL, '', '', '', '', 'radio', 1, '2020-07-15 16:18:07', 'off', 1, '{\"author\":\"{\\\"id\\\":1,\\\"name\\\":\\\"Fatima\\\"}\",\"use_html\":\"off\"}'),
(9, 1, '<div class=\\\"quiz_tablediv 7\\\">\n<div id=\\\"question-desc-align\\\" class=\\\"m_question1\\\">\n<div id=\\\"m_question_desc\\\" class=\\\"11 eleven_quest\\\">Which of the following software is used to view web pages?</div>\n<div class=\\\"clear\\\"></div>\n</div>\n</div>\n<div class=\\\"clear\\\"></div>\n<div class=\\\"answer_boxes flexboxes\\\">\n<div class=\\\"quiz_tablediv 12 multi_check_truefalse\\\">\n<div id=\\\"answer_option\\\">\n<div class=\\\"answer\\\"></div>\n</div>\n</div>\n</div>\n', NULL, '', '', '', '', 'radio', 1, '2020-07-15 16:21:36', 'off', 1, '{\"author\":\"{\\\"id\\\":1,\\\"name\\\":\\\"Fatima\\\"}\",\"use_html\":\"off\"}'),
